                <img src={place.pic} alt={place.name}/>
              </div>
            )
          })
          return (
            <Defut>
                <main>
                    <h1>PLACES INDEX PAGE</h1>
                    {placesFormatted}
                </main>
            </Defut>
        )
}





module.exports = places

